import React, { Component } from "react";
import Slider from "react-slick";
// Import css files
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
function Connectivity() {
  {
    const settings = {
      className: "center",
      centerMode: true,
      infinite: true,
      centerPadding: "60px",
      slidesToShow: 3,
      speed: 500
    };
    return (
      <div>
        <h2>Center Mode</h2>
        <Slider {...settings}>
          <div>
            <img className='' src="/images/hero.jpg" />
          </div>
          <div>
            <img className='' src="/images/experiance-bg.jpg" />
          </div>
          <div>
          <img className='' src="/images/hero.jpg" />
          </div>
          <div>
          <img className='' src="/images/experiance-bg.jpg" />
          </div>
          <div>
          <img className='rounded-full' src="/images/hero.jpg" />
          </div>
          <div>
          <img className='rounded-full' src="/images/experiance-bg.jpg" />
          </div>
        </Slider>
      </div>
    );
}
}
export default Connectivity
